Deleting collection and inserting array of docs via mongoDB Realm webhook<p>I have a use case where I want to send the contents of a csv file to a mongoDB collection whenever the file is modified. I found that a webhook could be created in mongoDB Realm. The intention of code below is to do 2 things. First, drop a specified collection in a specified db. Second, to insert many (~10k+) documents to the specified collection.</p>
<pre><code>exports = function(payload, response) {
    const {database, coll_to_update} = payload.query;
    const contentTypes = payload.headers[&quot;Content-Type&quot;];
    const body = payload.body;

    console.log(&quot;database, coll_to_update:&quot;, database, coll_to_update);
    console.log(&quot;Content-Type:&quot;, JSON.stringify(contentTypes));
    console.log(&quot;Request body:&quot;, body);

    const coll = context.services.get(&quot;mongodb-atlas&quot;).db(database).collection(coll_to_update);

    coll.deleteMany({})
      .then(result =&gt; console.log(`Deleted ${result.deletedCount} item(s).`))
      .catch(err =&gt; console.error(`Delete failed with error: ${err}`))

    coll.insertMany(body)
      .then(result =&gt; console.log(`Successfully inserted ${result.insertedIds.length} items!`))
      .catch(err =&gt; console.error(`Failed to insert documents: ${err}`))

    return payload;
};
</code></pre>
<p>This is being written in the Function editor in the online Realm UI. Because I could not find a way to drop the collection, I tried to delete all documents from it by passing an empty query. But I get an error saying <code>FunctionError: mongodb delete: no arguments were passed</code>. I am able to delete documents if I provide a query. Is there any query that would always match all documents I could use, or a better way to drop or delete all in a collection?</p>
<p>The second issue is I am not sure how to decode the contents of the csv sent in the request body. The curl I am using is below. Just for testing, I also sent it to <a href="http://httpbin.org/post" rel="nofollow noreferrer">http://httpbin.org/post</a> and the json is decoded correctly as an array of two objects:</p>
<pre><code>curl -H &quot;Content-Type: application/json&quot; -d [{\&quot;foo\&quot;:\&quot;bar\&quot;},{\&quot;baz\&quot;:\&quot;zap\&quot;}] \
&quot;https://eu-west-1.aws.webhooks.mongodb-realm.com/api/client/v2.0/app/application-0- \
abcdef/service/mongo_doodah/incoming_webhook/webhook0? \
database=FIC&amp;coll_to_update=FIC_data&amp;secret=not_this_one&quot;
</code></pre>
<p>When sending to the Realm endpoint however, I get error <code>FunctionError: mongodb insert: argument must be an array</code>. Checking the logs I see:</p>
<pre><code>Logs:
[
  &quot;database, coll_to_update: FIC FIC_data&quot;,
  &quot;Content-Type: [\&quot;application/json\&quot;]&quot;,
  &quot;Request body: [object Binary]&quot;
]

Body:
{
  &quot;$binary&quot;: {
    &quot;base64&quot;: &quot;W3siZm9vIjoiYmFyIn0seyJiYXoiOiJ6YXAifV0=&quot;,
    &quot;subType&quot;: &quot;00&quot;
  }
}
</code></pre>
<p>So Realm is working differently to, for example, pastebin in how it handles the json I sent. I cannot figure out how to get the json I sent out of this binary object within the Realm webhook editor.</p>

